        <style>
            :root {
                --color0: black;
                --color1: hsl(0 100% 50%);
                --color2: hsl(0 100% 25%);
                --color3: hsl(30 100% 50%);
                --color4: hsl(30 100% 25%);
                --color5: hsl(60 100% 50%);
                --color6: hsl(60 100% 25%);
                --color7: hsl(120 100% 50%);
                --color8: hsl(120 100% 25%);
                --color9: hsl(180 100% 50%);
                --color10: hsl(180 100% 25%);
                --color11: hsl(210 100% 50%);
                --color12: hsl(210 100% 25%);
                --color13: hsl(240 100% 50%);
                --color14: hsl(240 100% 25%);
                --color15: hsl(270 100% 50%);
                --color16: hsl(270 100% 25%);
                --color17: hsl(300 100% 50%);
                --color18: hsl(300 100% 25%);
                --color19: hsl(330 100% 50%);
                --color21: var(--color1);
                --color22: var(--color7);
                --color23: var(--color13);
                --color24: var(--color17);
            }

            body {
                margin: 0px;
                font-family: Arial, sans-serif;
            }

            .hour-number,
            .stationText {
                font-family: Arial;
                font-size: 16px;
            }

            .seconds00,
            .seconds10,
            .seconds20,
            .stationLine {
                stroke-width: 2;
            }

            .seconds00,
            .stationLine {
                stroke: #000000;
            }

            .seconds10 {
                stroke: #ececec;
            }

            .seconds20 {
                stroke: #7f7f7f;
            }

            .trainLabel {
                stroke-width: 4;
                stroke-linecap: round;
            }

            #id1,
            #tableDiv {
                width: 900px;
            }

            #id1 {
                height: 3em;
                display: flex;
                flex-direction: row;
                flex-wrap: nowrap;
                justify-content: space-around;
                align-items: center;
            }

            #tableDiv {}

            #tableDiv table {
                width: 100%;
            }

            #tableDiv td {
                width: 9.09%;
            }

            .checkBoxZoom {
                zoom: 2;
            }

            .header {
                position: fixed;
                height: 100px;
                display: flex;
                flex-direction: column;
                flex-wrap: wrap;
                justify-content: space-around;
            }

            #id2 {
                padding-top: 100px;
            }

            #toggleLineButton {
                width: 13%;
            }

            .noDisplay {
                display: none;
            }
        </style>
        <script>
            const getCurrentLine = () => localStorage.getItem("currentLine") || "1";
            const toggleLine = () => {
                getCurrentLine() === "1" ? localStorage.setItem("currentLine", "2") : localStorage.setItem("currentLine", "1");
                displayCurrentLineUI(getCurrentLine());
            };
            const displayCurrentLineUI = (lineID) => {
                toggleLineButton.innerHTML = `${lineID === "1" ? "Ленинская" : "Дзержинская"}${'</br>'}линия`;
                header.style.backgroundColor = lineID === "1" ? "#aa0000" : "#00aa00";
                document.querySelectorAll('.stationText, .stationLine').forEach((e, i) => {
                    if (e.classList.contains(`line${lineID}`)) e.classList.remove('noDisplay');
                    else e.classList.add('noDisplay');
                });
            };
            const displayTrainLabels = (className, display) => {
                const selector = `.trainLabel.line${getCurrentLine()}.${className}`;
                document.querySelectorAll(`.trainLabel.${className}`).forEach((label, i) => {
                    if (display && label.classList.contains(`line${getCurrentLine()}`)) label.classList.remove('noDisplay');
                    else label.classList.add('noDisplay');
                });
            };
            const getDayType = () => {
                const date = new Date();
                date.setHours(date.getHours() - 2);
                const dayOfWeek = date.getDay();
                if (dayOfWeek === 0 || dayOfWeek === 6) return 1;
                else return 0;
            };
            document.addEventListener('DOMContentLoaded', () => {
                const [checkbox0, checkbox1, toggleLineButton, header] = ['checkbox0', 'checkbox1', 'toggleLineButton', 'header'].map((id) => document.getElementById(id));
                displayCurrentLineUI(getCurrentLine());
                if (getDayType() === 0) {
                    checkbox0.checked = true;
                    checkbox1.checked = false;
                    displayTrainLabels('type0', true);
                }
                if (getDayType() === 1) {
                    checkbox0.checked = false;
                    checkbox1.checked = true;
                    displayTrainLabels('type1', true);
                }
                checkbox0.addEventListener('change', () => { displayTrainLabels('type0', checkbox0.checked); });
                checkbox1.addEventListener('change', () => { displayTrainLabels('type1', checkbox1.checked); });
                toggleLineButton.addEventListener("click", () => {
                    toggleLine();
                    displayTrainLabels('type0', checkbox0.checked);
                    displayTrainLabels('type1', checkbox1.checked);
                });
            });
        </script>
